text = ""
k = 11
L = 531
t = 19

def Count(text, pattern):
    count = 0
    for i in range(len(text) - len(pattern) + 1):
        if text[i:i+len(pattern)] == pattern:
            count = count + 1
    return count

def FrequencyList(text, k, t):
    l = []
    for i in range(len(text) - k + 1):
        q = Count(text[i:], text[i : i + k])
        if(q >= t and text[i : i + k] not in l):
            l.append(text[i : i + k])
    return l

l1 = [] ##lista da bismo izbjegli ponavljanje ispisa

for i in range(len(text) - L):
    l = FrequencyList(text[i:i+L], k, t)
    for j in l:
        if(j not in l1):
            l1.append(j)

for i in l1:
    print(i, end = " ")
